import { Component, Vue } from 'vue-property-decorator';

@Component({})
export default class Tutorial extends Vue {
  showSkip = false;

  onSlideChangeStart() {
    this.showSkip = true;
  }

  endTutorial() {
    this.$store.dispatch('sawTutorial');
    this.$router.push('/speakers');
  }
}
